import Card from './Card'

const Home = ({ data }) => {

    if (data) {
        return (
            <main>
                {data.map((card) => {
                    return <Card card={card} />
                })}
            </main>
        )
    }

    return (
        <main>
            {data.map((card) => {
                return <Card card={card} />
            })}
        </main>
    )
}

export default Home
